import React from 'react'
import "./contact.css"

const Contact = () => {
    const iframe = '<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d15437.362143248582!2d26.629617190081888!3d38.32038384144581!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x14bb90f9aaaaaaab%3A0xed70c1a0fe6503c9!2sIzmir%20Institute%20of%20Technology%20%C4%B0YTE!5e0!3m2!1sen!2str!4v1650542361267!5m2!1sen!2str" width="400" height="300" style="border:0;" allowfullscreen="" loading="lazy" referrerpolicy="no-referrer-when-downgrade"></iframe>';
    
    const Iframe = (props) => {
        return (<div dangerouslySetInnerHTML={ {__html:  props.iframe?props.iframe:""}} />);
    }
  return (
      <div className='contact-mock'>
          <div className='flex-for-contact'>
              <div className='column-contact'>
                süüüüüüüüüüüüüüüüüüüüü üüüüüüüüüüüüüüüüüüüü üüüüüüüüüüüü üüüüüüüüüüüüüüüüüüüüüü
              </div>
              <div className='column-contact'>
                  <Iframe iframe={iframe}/>
              </div>
          </div>
      </div>
  )
}

export default Contact
